import Account from "./components/account";
import './sass/main.css';
import React from "react";
import {
  BrowserRouter, Routes, Route } from "react-router-dom";
import Item from "./components/item";
import ImageUpload from "./components/imageUpload";
import Signup from "./components/signup";
import ItemProperty from "./components/itemProperty";
import ReactHookFormDemo from "./components/login";
import googleLogin2 from "./components/googleLogin2";
import googleLogin from "./components/googleLogin";
import "primereact/resources/themes/lara-light-indigo/theme.css";  //theme
import "primereact/resources/primereact.min.css";                  //core css
import "primeicons/primeicons.css";        
import 'primeflex/primeflex.css';
import './App.css';


function App() {

return (
    <BrowserRouter>
      <Routes>
        <Route path = "googleLogin2" element={<googleLogin2/>}/>
        <Route path = "item" element={<Item/>}/>
        <Route path = "signup" element={<Signup/>} />
        <Route path = "account" element={<Account/>}/>
        <Route path = "imageUpload" element={<ImageUpload/>} />
        <Route path = "itemProperty" element={<ItemProperty/>} />
        <Route path = "login" element={<ReactHookFormDemo/>}/>
      </Routes> 
    </BrowserRouter>
  )};

export default App;
